import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Home = () =>{
    return(
        <>
        <h1>ASAD Rehman</h1>
        
        <section className="header">
            <div className="container">
                <div className="row">
                    <div className="col-6 round-1">
                        
                    </div>
                </div>
            </div>
        </section>

        </>
    )
}

export default Home;
